import "../styleComponents/page1.css";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
} from "react-router-dom";
import Pic from "../bg3.png"
import Footer from "./footer";
import Button from "./button";
import Page2 from "./page2";
import { AiOutlineArrowRight } from "react-icons/ai";

const Page1 = () => {
  const redirect = () => {
    <Router>
      <Switch>
        <Route exact path="/" components={Page2} />
        <Redirect to="/" />
      </Switch>
    </Router>
  }
    return (
      <>
        <div className="container">
          <div className="row">
            <div className="col-lg-6">
              <img className="img" src={Pic} alt="img" width="100%" />
              </div>
            <div className="col-lg-6">
          <div className="text-content">
            <h3>Welcome to</h3>
            <h1>The Study Buddy</h1>
            <p>
              A place where you can solve all of your study related queries,{" "}
              <br /> have an access to prebuilt assignment, journals made by
              scholers. <br /> Hangout with new friends and much more!
            </p>
                <Button
                  icon={<AiOutlineArrowRight />}
                  btn_text={`Get Started`}
                  onClick={redirect}
                />
              </div>
              </div>
            </div>
        </div>
        <Footer className="fixed-bottom" />
      </>
    );
}

export default Page1;
